import{_ as o,c as i,I as n,C as e,a as g,V as c,o as h,J as a}from"./chunks/framework.f518e559.js";const q=JSON.parse('{"title":"浙江衢州 QuZhou √","description":"","frontmatter":{"title":"浙江衢州 QuZhou √"},"headers":[],"relativePath":"views/travel/domestic/ZjQz.md"}'),s={name:"views/travel/domestic/ZjQz.md"},u=e("h6",{id:"从老家回杭州要路过衢州-然后我就自己坐绿皮来找方阿姨玩哈哈哈",tabindex:"-1"},[g("从老家回杭州要路过衢州，然后我就自己坐绿皮来找方阿姨玩哈哈哈 "),e("a",{class:"header-anchor",href:"#从老家回杭州要路过衢州-然后我就自己坐绿皮来找方阿姨玩哈哈哈","aria-label":'Permalink to "从老家回杭州要路过衢州，然后我就自己坐绿皮来找方阿姨玩哈哈哈"'},"​")],-1),m=c('<h3 id="_2018-10-04-🌞-😎" tabindex="-1">2018.10.04 🌞 😎 <a class="header-anchor" href="#_2018-10-04-🌞-😎" aria-label="Permalink to &quot;2018.10.04 🌞 😎&quot;">​</a></h3><p>与方阿姨汇合之后方阿姨就带着我就直奔鸭头、兔头还有炒粉干,鸭头是真的好吃！兔头炒粉干也一样<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/26.jpg?imageMogr2/auto-orient" height="200"><br> 吃完中饭我们就开始瞎逛，这次方阿姨是带着让我吃到全衢州的小吃的决心的哈哈<br> 走到了一处公园，蛮大的，然后去了孔庙，在里面走马观花，紧接着又去了衢州博物馆（ps：中间那只大恐龙还是蛮壮观）<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/4.jpg?imageMogr2/auto-orient" height="300"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/2.jpg?imageMogr2/auto-orient" height="300"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/7.jpg?imageMogr2/auto-orient" height="300"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/8.jpg?imageMogr2/auto-orient" height="300"><br> 然后我们一路走一路聊一路吃，衢州的东西全部都好吃，非常对我胃口，以后有机会还会再来找方阿姨一次哈哈<br> 👇前往城墙<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/13.jpg?imageMogr2/auto-orient" height="300"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/14.jpg?imageMogr2/auto-orient" height="300"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/15.jpg?imageMogr2/auto-orient" height="300"><br> 晚上吃了砂锅，然后方阿姨因为要赶车的原因先回家了<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/16.jpg?imageMogr2/auto-orient" height="300"><br> 方阿姨让我在城墙看一看喷泉看一看投影看一看夜景,实景超级好看<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/18.jpg?imageMogr2/auto-orient" height="170"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/24.jpg?imageMogr2/auto-orient" height="170"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/27.jpg?imageMogr2/auto-orient" height="170"><br> 👇美食环节，虽然有些现在叫不出来名字了<br><img src="http://cdn.chenyingshuang.cn/journey/zjqz/26.jpg?imageMogr2/auto-orient" height="200"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/20.jpg?imageMogr2/auto-orient" height="200"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/21.jpg?imageMogr2/auto-orient" height="200"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/22.jpg?imageMogr2/auto-orient" height="200"><img src="http://cdn.chenyingshuang.cn/journey/zjqz/16.jpg?imageMogr2/auto-orient" height="200"><br></p><p>这次旅行真的是临时起意，刚好方阿姨还有空接待我，真是太感谢她哈哈，衢州很好吃~<br></p>',3);function p(j,d,z,y,_,l){const t=a("base-common-TrainTicket"),r=a("common-ImageWall");return h(),i("div",null,[u,n(t,{startStation:"玉山",startStationEn:"YuShan",endStation:"衢州",endStationEn:"QuZhou",date:"2018/10/04 09:29",trainType:"K",trainId:"210",trainNum:"06",trainSeatNum:"092",checkIn:"none",id:"A005275",footer:"32666310141005A005275玉山售",price:"14.5",trainSeatLv:"新空调硬座"}),n(t,{startStation:"衢州",startStationEn:"QuZhou",endStation:"杭州",endStationEn:"HangZhou",date:"2018/10/04 19:55",trainType:"G",trainId:"1374",trainNum:"03",trainSeatNum:"18F",checkIn:"none",id:"Z22G030266",footer:"32621300221005G030266衢州售",price:"109.5"}),n(r,{value:"journey/zjqz/",number:30}),m])}const M=o(s,[["render",p]]);export{q as __pageData,M as default};
